<style>
    .contact-us {
        width: 100%;
        min-height: 50vh;
        flex-flow: column nowrap;
        justify-content: flex-start;
        background-color: var(--back-white);
    }

    .title {
        font-family: 'Julius Sans One';
        width: 100%;
        height: 65.5px;
        background-color: var(--dark-gray);
        justify-content: flex-start;
        padding: 0 20px;
    }

    .title p {
        font-size: 1.5rem;
    }

    .content {
        border: 6px solid var(--dark-gray);
        border-top: 0px;
        width: 100%;
        flex-grow: 1;
        flex-flow: column nowrap;
        justify-content: flex-start;
    }

    .content>div {
        width: 100%;
    }

    .contact {
        width: 100%;
        flex-flow: row wrap;
        flex-grow: 1;
    }

    .contact>* {
        flex-grow: 1;
        font-size: 1rem;
        margin: 20px 10px;
    }

    .address {
        justify-content: space-around;
        flex-flow: row nowrap;
        align-items: center;
        max-width: 75ch;
        width: 100%;
    }

    .address>p {
        text-align: left;
        margin: 5px 20px;
        line-height: 2rem;
    }

    .number {
        flex-flow: row nowrap;
        align-items: center;
        max-width: 75ch;
        width: 100%;
    }

    .number>div {
        flex-flow: column nowrap;
        align-items: flex-end;
        padding: 5px 20px;
        flex-grow: 1;
    }

    .number>div>a {
        margin: 5px 0;
    }

    .cta {
        width: 100%;
        height: 50px;
        font-family: 'Julius Sans One';
        font-size: 1.2rem;
        text-decoration: none;
        padding: 0 40px;
        background-color: white;
        border-radius: 10px;
    }

    .dark {
        background-color: var(--dark-gray);
    }

    .whatsapp p {
        color: #25D366;
    }
</style>

